import{_ as e,o as t,c as r,e as a}from"./app.efeddd24.js";const o={},p=a('<h1 id="\u7B49\u5F85\u60CA\u559C-\u4F46\u522B\u754F\u60E7\u5931\u671B" tabindex="-1"><a class="header-anchor" href="#\u7B49\u5F85\u60CA\u559C-\u4F46\u522B\u754F\u60E7\u5931\u671B" aria-hidden="true">#</a> \u7B49\u5F85\u60CA\u559C, \u4F46\u522B\u754F\u60E7\u5931\u671B</h1><p>\u6628\u5929\u665A\u4E0A, \u6211\u4EEC\u8FDB\u884C\u4E86\u4E00\u6B21\u6CA1\u6709\u5C0F\u674E\u624D\u5E08\u7684 FSTD \u8BFB\u7ECF\u5C0F\u7EC4\u7684\u5B66\u4E60\u6D3B\u52A8.</p><p>\u56E0\u4E3A\u5C0F\u674E\u8001\u5E08\u6700\u8FD1\u6BD4\u8F83\u5FD9, \u6240\u4EE5\u4ED6\u5DF2\u7ECF\u6709\u51E0\u5468\u65F6\u95F4\u6CA1\u6709\u7EC4\u7EC7\u8BFB\u7ECF\u5C0F\u7EC4\u6D3B\u52A8\u4E86. \u8FD9\u5468\u4ED6\u53C8\u56E0\u4E3A\u6CA1\u6709\u65F6\u95F4, \u65E0\u6CD5\u7EC4\u7EC7\u8BFB\u7ECF\u5C0F\u7EC4\u7684\u5B66\u4E60\u6D3B\u52A8. \u4F46\u662F\u4ED6\u8BF4, \u4F60\u4EEC\u53EF\u4EE5\u81EA\u5DF1\u7EC4\u7EC7\u5B66\u4E60\u6D3B\u52A8.</p><p>\u4E8E\u662F\u5C31\u6709\u4E86\u6628\u5929\u665A\u4E0A\u7684\u5B66\u4E60\u6D3B\u52A8.</p><p>\u5B66\u4E60\u6D3B\u52A8\u7ED3\u675F\u540E, \u6211\u4EEC\u5728\u4E00\u8D77\u95F2\u804A, \u76F8\u4E92\u95EE\u5BF9\u65B9\u4ECA\u5929\u6709\u6CA1\u6709\u542F\u53D1. \u6211\u7684\u611F\u89C9\u662F, \u4E3B\u8981\u7684\u542F\u53D1\u5927\u90FD\u4EA7\u751F\u5728\u51C6\u5907\u9636\u6BB5, \u5728\u8BA8\u8BBA\u7684\u8FC7\u7A0B\u4E2D\u597D\u50CF\u6CA1\u6709\u53D7\u5230\u5927\u7684\u542F\u53D1.</p><p>\u4E8E\u662F\u6211\u5728\u60F3, \u4E3A\u4EC0\u4E48\u5C0F\u674E\u8001\u5E08\u5728\u7684\u65F6\u5019, \u6211\u4EEC\u5C31\u53EF\u4EE5\u53D7\u5230\u5F88\u5927\u7684\u542F\u53D1, \u800C\u6211\u4EEC\u81EA\u5DF1\u7EC4\u7EC7\u8BA8\u8BBA\u7684\u65F6\u5019, \u6211\u4EEC\u7684\u542F\u53D1\u5C31\u6CA1\u6709\u90A3\u4E48\u5927\u5462. \u8FDB\u800C\u60F3\u5230, \u5982\u679C\u5C0F\u674E\u8001\u5E08\u5728, <strong>\u4ED6\u5C06\u4EE5\u4EC0\u4E48\u6837\u7684\u65B9\u5F0F\u4F7F\u6211\u4EEC\u53D7\u5230\u542F\u53D1\u5462</strong>.</p><p>\u7A81\u7136\u60F3\u8D77\u4E0A\u6B21\u5B66\u4E60\u300A\u739B\u7AA6\u798F\u97F3\u300B\u7B2C\u516B\u7AE0, \u7B2C\u4E5D\u7AE0\u65F6\u6211\u4EEC\u53D7\u5230\u7684\u542F\u53D1: <strong>\u4FE1\u5FC3\u8981\u4F53\u73B0\u5728\u7EC6\u8282\u91CC</strong>. \u662F\u554A, \u4FE1\u5FC3\u8981\u4F53\u73B0\u5728\u7EC6\u8282\u91CC, \u542F\u53D1\u4E5F\u4F53\u73B0\u5728\u7EC6\u8282\u91CC. \u6BCF\u6B21\u5C0F\u674E\u8001\u5E08\u80FD\u5E26\u7ED9\u4EEC\u542F\u53D1\u7684\u5730\u65B9, \u5F80\u5F80\u662F\u6DF1\u5165\u5230\u7ECF\u6587\u548C\u9053\u7406\u7684\u7EC6\u8282\u91CC. \u8FD9\u4E5F\u662F\u6211\u4EEC\u81EA\u5DF1\u5728\u8BA8\u8BBA\u7684\u65F6\u5019\u5B58\u5728\u7684\u95EE\u9898: \u6211\u4EEC\u7684\u8BA8\u8BBA\u53EF\u80FD\u6700\u540E\u505C\u7559\u5728\u4E86\u4E00\u4E9B\u6846\u67B6\u6027\u7684\u9053\u7406\u4E0A, \u6BD4\u5982\u6211\u4EEC\u8BF4\u7B2C\u5341\u7AE0\u8BF4\u7684\u5C31\u662F\u5173\u4E8E\u6743\u67C4\u7684\u95EE\u9898\uFF0C \u6211\u4EEC\u8BF4\u4E3B\u8036\u7A23\u6765\u5C31\u662F\u8981\u6253\u7834\u8840\u7F18\u8054\u63A5\u7684\u65E7\u6C11\u65CF\u5F62\u6210\u65B0\u6C11\u65CF, \u5F53\u7136\u770B\u8D77\u6765\u6709\u9053\u7406\u5728\u91CC\u8FB9, \u800C\u4E14\u8BF4\u4E0D\u5B9A\u9053\u7406\u4E5F\u662F\u5BF9\u7684, \u4F46\u6211\u4EEC\u5C31\u6709\u8FD9\u6837\u7684\u8BA4\u8BC6, \u4E5F\u8FD8\u4F9D\u7136\u4E0D\u77E5\u9053\u5173\u4E8E\u8036\u7A23\u5173\u4E8E\u6743\u67C4\u7684\u8BA8\u8BBA\u5BF9\u6211\u4EEC\u771F\u5B9E\u7684\u751F\u6D3B\u6709\u4EC0\u4E48\u610F\u4E49, \u4E5F\u5E76\u4E0D\u771F\u7684\u5F97\u5C31\u77E5\u9053\u5982\u4F55\u6210\u4E3A\u65B0\u7684\u6C11\u65CF.</p><p>\u60F3\u5230\u8FD9\u91CC, \u6211\u89C9\u5F97\u6211\u4EEC\u5E94\u8BE5\u6709\u4E00\u4E2A\u81EA\u6211\u8981\u6C42: \u5F53\u6211\u4EEC\u5728\u8C08\u8BBA\u4E8B\u60C5\u7684\u65F6\u5019, \u6211\u4EEC\u5E94\u8BE5\u5C55\u73B0\u51FA\u5176\u4E2D\u7EC6\u8282\u6765.</p><hr><p>\u300A\u739B\u7AA6\u798F\u97F3\u300B\u662F\u4E00\u90E8\u7ED3\u6784\u4E0A\u975E\u5E38\u4E25\u8C28\u7684\u798F\u97F3\u4E66. \u5B83\u4E00\u5171\u5206\u4E3A\u4E94\u4E2A\u90E8\u5206, \u6BCF\u4E2A\u90E8\u5206\u53C8\u6309\u7167\u5148\u5199\u8036\u7A23\u7684\u884C\u4E3A, \u540E\u5199\u8036\u7A23\u7684\u6559\u5BFC.</p>',10),_=[p];function n(s,c){return t(),r("div",null,_)}var h=e(o,[["render",n],["__file","\u7B49\u5F85\u60CA\u559C.html.vue"]]);export{h as default};
